const appMenuData = 'appmenu'

declare const Jimp

class appsManager {
	public mainPages = ko.observable( null )
	public mainLoading = ko.observable ( true )
	public loadingError = ko.observable ( null )
	public mainHtml = ko.observable ( '' )
	public appHtml = ko.observable ( false )
	public appScript = ko.observable ()
	public showMain = ko.observable ( false )
	public showMainMenu = ko.observable ( true )
	public loadingGetResponse = ko.observable ( false )
	public conetResponse = ko.observable ( false )
	public showSnapshop = ko.observable ( false )
	private appMenu = this.getAppMenu ()
	public runningAppHtml = ko.observable ( null )
	public showAppMain = ko.observable ( false )
	public AppObj = {}
	public appLoadingError = ko.observable ( false )
	public appLoadingErrorIndex = ko.observable (null)
	/***
	 * 
	 * 		debug temp 
	*/

	public showTempMain = ko.observable ( false )
	public tempAppHtml = ko.observable ( false )

	/**
	 * 		
	 */

	public mainScript = ko.observable (null)

	private getAppMenu () {

		const uu = window.localStorage.getItem ( appMenuData )
		try {
			return JSON.parse ( uu )
		} catch ( ex ) {
			return null
		}
	}

	private initMenuArray ( mainMenuArray ) {
		mainMenuArray.forEach ( n => {
			n['loading'] = ko.observable ( false )
			n['loadingGetResponse'] = ko.observable ( false )
			n['conetResponse'] = ko.observable ( false )
			
		})

	}

	private showLoadingGetResponse ( item ) {
		item.loadingGetResponse ( true )
		item.conetResponse ( false )
	}

	private showConetResponse ( item ) {
		item.loadingGetResponse ( false )
		item.conetResponse ( true )
	}

	private getAppObject ( mainMenuItem ) {
		for ( let i = 0; i < mainMenuItem.length; i ++ ) {
			const uu = mainMenuItem[i]
			if ( uu.active ) {
				const objName = `APP-${ i }`
				const kk = window.localStorage.getItem ( objName )
				try {
					this.AppObj[ objName ] = JSON.parse ( kk )
				} catch ( ex ) {

				}
				
			}
		}
	}

	public updateAppsManu ( _self = null ) {
		const self = _self || this
		self.appLoadingError ( false )
		/**
		 * 
		 * 		DEBUG use Temp Pug
		 * 
		 */
		
		const _mainMenuObj = _mainMenuObj111
		self.initMenuArray ( _mainMenuObj.mainMenuItem )
		_mainMenuObj['_mainMenuItem'] = ko.observableArray ( _mainMenuObj.mainMenuItem )
		self.mainLoading ( false )
		self.showTempMain ( true )
		return self.mainScript ( _mainMenuObj )
		/** */
		
		const viewMainMenuu = () => {
			
			self.mainHtml ( self.appMenu [1] )
			
			const _mainMenuObj = JSON.parse ( self.appMenu [2] )
			self.initMenuArray ( _mainMenuObj.mainMenuItem )

			_mainMenuObj['_mainMenuItem'] = ko.observableArray ( _mainMenuObj.mainMenuItem )

			self.mainScript ( _mainMenuObj )
			self.showMain ( true )
			self.mainLoading ( false )
			self.mainLoading ( false )
			self.conetResponse ( false )
			_view.connectInformationMessage.hideMessage()
			this.getAppObject ( _mainMenuObj.mainMenuItem )
		}

		if ( this.appMenu && this.appMenu.length ) {

			viewMainMenuu ()
			
		}

		const showError = ( err ) => {
			self.mainLoading ( false )
			//_view.connectInformationMessage.hideMessage()
			self.loadingError ( _view.connectInformationMessage.getErrorIndex ( err ) )
			self.loadingGetResponse ( false )
			return self.conetResponse ( false )
		}
		
		const com: QTGateAPIRequestCommand = {
			command: 'mainMenu',
			Args: this.appMenu && this.appMenu[0] ? this.appMenu[0]: null ,
			error: null,
			subCom: null
		}

		return _view.keyPairCalss.emitRequest ( com,( err, com: QTGateAPIRequestCommand ) => {
		
			if ( err ) {
				return showError ( err )
			}

			if ( !com ) {
				self.conetResponse ( false )
				return self.loadingGetResponse ( true )
			}

			if ( com.error === -1 ) {
				self.loadingGetResponse ( false )
				return self.conetResponse ( true )
			}

			if ( com.error ) {
				return showError ( com.error  )
			}
			_view.connectInformationMessage.hideMessage ()
			if ( !com.Args || !com.Args.length ) {
				return
			}

			this.appMenu = com.Args
			
			if ( typeof Storage !== "undefined" ) {
				
				window.localStorage.setItem ( appMenuData, JSON.stringify ( com.Args ))
			}

			
			
			return viewMainMenuu ()

		})
		
	}

	public mainNemuError () {
		this.exit ()
	}




	public appClick ( appIndex: number ) {

		const self = this
		const item = self.mainScript().mainMenuItem[ appIndex ]
		self.mainScript()._mainMenuItem ([ item ])
		item.loading ( true )

		const runningApp = ( obj ) => {
			_view.bodyBlue ( false )
			_view.showIconBar ( false )
			this.showMainMenu ( false )

			/**
			 * 
			 * 			DEBUG APP use Temp pug
			 * 
			 */

			
			
			this.tempAppHtml ( true )
			
			appScript.startup ( appScript )
			
			this.appScript ( appScript )
			_view.CanadaBackground ( true )
			return 
			/** */


			/**
			 * 
			 * 			Use appHtml 
			 */

			

			/*
			this.runningAppHtml ( appHtml )
			this.appHtml ( true )
			
			this.showAppMain ( true )
			appScript.startup ( appScript )
			
			this.appScript ( appScript )

			/** */

			this.runningAppHtml ( obj[1] )
			this.appHtml ( true )
			
			eval ( obj[2])
			appScript.startup ( appScript )
			this.appScript ( appScript )
			this.showAppMain ( true )
		}

		const AppName = `APP-${ appIndex }`
		let obj = this.AppObj[ AppName ]

		/**
		 * 
		 * 		use Debug 
		 * 
		 */
		
		return runningApp ( null )

		/** end Debug */



		if ( obj ) {
			runningApp ( obj )
		}

		const com: QTGateAPIRequestCommand = {
			command: AppName,
			Args: obj && obj[0] ? obj[0]: null,
			error: null,
			subCom: null
		}

		const showError = ( err ) => {
			item.loading ( false )
			self.appLoadingErrorIndex ( _view.connectInformationMessage.getErrorIndex ( err ))
			return self.appLoadingError ( true )
			
		}

		return _view.keyPairCalss.emitRequest ( com, ( err, com: QTGateAPIRequestCommand ) => {
		
			if ( err ) {
				return showError ( err )
			}

			if ( !com ) {
				self.conetResponse ( false )
				return self.loadingGetResponse ( true )
			}

			if ( com.error === -1 ) {
				self.loadingGetResponse ( false )
				return self.conetResponse ( true )
			}

			if ( com.error ) {
				return showError ( com.error  )
			}
			_view.connectInformationMessage.hideMessage ()
			if ( !com.Args || !com.Args.length ) {
				return
			}

			obj = com.Args
			
			if ( typeof Storage !== "undefined" ) {
				
				window.localStorage.setItem ( AppName, JSON.stringify ( com.Args ))
			}

			
			
			return runningApp ( obj )

		})


		
		
		
	}

	constructor ( private exit: () => void ) {

		_view.sectionLogin ( false )
		this.updateAppsManu()

	}
}